import React from "react";
import { io } from "socket.io-client";

const socket = io("http://localhost:4000/", { transports : ['websocket'] });
socket.on('connect', () => {
    console.log('Connected', socket.id); 
});

function Worduel() {
    return (
        <div>
            <h1>Worduel!</h1>
        </div>
    )
}

export default Worduel;
